<h3>subterlabor</h3>
<div>subter-lābor, —, lābī <em>depon.</em></div>
<div>1) протекать под, омывать внизу (<em>flumina antiquos subterlabentia muros V</em>)</div>
<div>2) уходить (от преследования), ускользать (<em>celeritate L</em>)</div>
